import { Box } from '@mui/material'
import React from 'react'
import ImageCarousel from './ImageCarousel'
import HighlightSection from './components/HighLightSection';


const Home = () => {
  return (
    <Box sx={{height: "400px"}}>
      <ImageCarousel />
      <HighLightSection />
    </Box>
  )
}

export default Home
